		"text": "@SellarsRespectr @bayesianboy @birchlse You mean that qualia are posited internal states modelled upon paintings, etc? That's certainly an illusionist view, and I'm sympathetic to (as is Dennett, I think), though I'd say that sense data are such posits, and qualia are watered-down sense data."
